import React from 'react';
import ReactDOM from 'react-dom';
import {add, sub, div, mul} from './calc';
ReactDOM.render(
  <>
    <ul>
        <li>Sum            = {add(2, 3)}</li>
        <li>Subtraction    = {sub(3, 2)}</li>
        <li>Division       = {div(10, 3)}</li>
        <li>Multiplication = {mul(10, 3)}</li>
    </ul>
  </>,
  document.getElementById('root')
);
